answer = ifScript();

function ifScript() {
	var send_daily=(gs.getProperty('x_mmsi_acknowledge.SendDailyMessagesAfterFirstReminder','false') == 'true');
	workflow.scratchpad.send_daily=send_daily;
	if (send_daily) {
		return 'yes';
	}
	return 'no';
}

(function() {
	// return the value to use for Parameter 1
	return current.sys_id;
}());

(function() {
	// return the value to use for Parameter 2
	return current.acknowledgers;
}());

// if reminderdays==0
answer = ifrd0Script();

function ifrd0Script() {
	if (workflow.scratchpad.reminderDays > 0) {
		return 'yes';
	}
	return 'no';
}

// Set 'answer' to the number of seconds this timer should wait
// Workflow schedule is Weekdays 8x5 -- = 9 hours per day

//answer = parseInt(workflow.scratchpad.reminderDays) * 60 seconds/day * 60 minutes/day * (Scheduled Hours) / day;
//answer = parseInt(workflow.scratchpad.reminderDays) * 60 * 60 * 24;
answer = parseInt(workflow.scratchpad.reminderDays) * 60 *60 * 24;
